exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.xbiqugee.com/index/${bid}/${1===page?"":page+"/"}`,".section-list",{...options,clientOptions,pageSize:50,totalPagesRegex:/value="\/index\/52\/(?<totalPages>\d+)\/"[^>]*>[^<]+<\/option>\s*<\/select>/})};